import styled from 'styled-components';

export const Container = styled.div`
    width:80%;
    min-height:400px;
`;

export const Title = styled.div`
    font-family: 'GmarketSansMedium', '나눔고딕', NanumGothic, '돋움', Dotum, sans-serif;
    font-size:1.6rem;
    font-weight:bold
    color:#333;
    border-bottom: 1px solid #bfbfbf;
    padding-bottom: 7px;
    margin-bottom: 7px;
`;
